def remainingStartSerial = context.expand( '${Serialized remaining product#res_startSerial}' ).toInteger();
def remainingEndSerial = context.expand( '${Serialized remaining product#res_endSerial}' ).toInteger();
def quantityTwo = context.expand( '${Given properties for the test steps#quantityTwo}' ).toInteger();

if ( ( remainingStartSerial + remainingEndSerial ) % 2 == 0) {
	int bySerialStartSerial = ( remainingStartSerial + remainingEndSerial ) / 2;
	int bySerialEndSerial = bySerialStartSerial + quantityTwo - 1;
	testRunner.testCase.testSteps['Given properties for the test steps'].setPropertyValue("autoSliceBySerialStartSerial", bySerialStartSerial.toString());
	testRunner.testCase.testSteps['Given properties for the test steps'].setPropertyValue("autoSliceBySerialEndSerial", bySerialEndSerial.toString());
}
else {
	 int bySerialStartSerial = ( remainingStartSerial + remainingEndSerial + 1 ) / 2;
	 int bySerialEndSerial = bySerialStartSerial + quantityTwo - 1;
	 testRunner.testCase.testSteps['Given properties for the test steps'].setPropertyValue("autoSliceBySerialStartSerial", bySerialStartSerial.toString());
	 testRunner.testCase.testSteps['Given properties for the test steps'].setPropertyValue("autoSliceBySerialEndSerial", bySerialEndSerial.toString());
}

